      const payloadItem = {
        product: Product
      };
      if (Product !== undefined && Product !== '' && Product !== null) {
        $.ajax({
          type: "POST",
          contentType: "application/json",
          url: url + "getParticularItemList",
          data: JSON.stringify(payloadItem), // Send as JSON string
          success: function (response) {
            console.log("Success:", response.value.value);
            localModel.setProperty("/ParticularMaterial", response.value.value[0]);
            localModel.setProperty("/cartdata/material", response.value.value[0].Product)
            localModel.setProperty("/isButtonVisible", true);
            if (response.value.value[0].Product === 'FG011') {
              localModel.setProperty("/path1", "./images/FG011.jpg")
            } else if (response.value.value[0].Product === 'FG031') {
              localModel.setProperty("/path1", "./images/FG031.jpg")
            }
            else if (response.value.value[0].Product === 'FG032') {
              localModel.setProperty("/path1", "./images/FG032.jpg")
            }

            else if (response.value.value[0].Product === 'FG0504') {
              localModel.setProperty("/path1", "./images/FG0504.jpg")
            }

            else if (response.value.value[0].Product === 'FG0502') {
              localModel.setProperty("/path1", "./images/FG0502.jpg")
            }


          },
        });
        localModel.setProperty("/isexpandable", true)
      }

