    // Utility function to format date
    formatDate: function (dateString) {
      if (dateString) {
        const timestamp = parseInt(dateString.replace(/\/Date\((\d+)\)\//, '$1'), 10);
        const date = new Date(timestamp);
        const year = date.getFullYear();
        const month = String(date.getMonth() + 1).padStart(2, '0');
        const day = String(date.getDate()).padStart(2, '0');
        return `${year}-${month}-${day}`;
      }
      return null;
    },

    _initMockServer: function () {
      this._oMockServerDefault = new MockServer({
        rootUri: "uimockdisplay/"
      });
      this._oMockServerDisplayValue = new MockServer({
        rootUri: "uimockdisplay/"
      });

      this._oMockServerDefault.simulate("model/uimock.xml", {
        sMockdataBaseUrl: "model"
      });

      this._oMockServerDisplayValue.simulate("model/uimock.xml", {
        sMockdataBaseUrl: "model"
      });

      this._oMockServerDefault.start();
      this._oMockServerDisplayValue.start();
    },
    onExit: function () {
      this._oMockServerDefault.stop();
      this._oMockServerDisplayValue.stop();
    },
    handleValueHelp: function (oEvent) {
      var sInputValue = oEvent.getSource().getValue(),
        oView = this.getView();
      this._sInputId = oEvent.getSource().getId();
      if (!this._pValueHelpDialog) {
        this._pValueHelpDialog = Fragment.load({
          id: oView.getId(),
          name: "nuvo.fragments.MaterialList",
          controller: this,
        }).then(function (oDialog) {
          oView.addDependent(oDialog);
          return oDialog;
        });
      }
      this._pValueHelpDialog.then(function (oDialog) {
        // Create a filter for the binding
        // Open ValueHelpDialog filtered by the input's value
        oDialog.open();
      });

    },

    onPressValuHelp: function (oEvent) {
      const selectedItem = oEvent.getParameter("selectedItem");
      if (selectedItem) {
        const selectedName = selectedItem.getTitle(); // Get the name
        const input = this.byId(this._sInputId);
        input.setValue(selectedName); // Set the name in the Input field

        MessageBox.information("You have selected " + selectedName + " .");
        // Update the model to make the button visible
        const localModel = this.getView().getModel("localModel");
        localModel.setProperty("/isButtonVisible", true);
      }


    },
