    onPlaceOrder: function () {
      const that = this;
      const url = this.getOwnerComponent().getModel().getServiceUrl()
      this.initializeBusyDialog2();
      this._busyDialog2.open();
      const localModel = this.getView().getModel("localModel");
      const CustWiseCart = localModel.getProperty("/CustWiseCart");
      const custID = localModel.getProperty("/customerID");
      const salesorder = {
        SalesOrderType: "OR", // Static or dynamic based on your use case
        SoldToParty: custID, // Static or dynamic based on customer
        to_Item: {
          results: [] // Initialize the array for items
        }
      };
      CustWiseCart.forEach((item, index) => {
        salesorder.to_Item.results.push({

          Material: item.material, // Replace with actual field name
          RequestedQuantity: String(item.RequestedQuantityI), // Replace with actual field name
          RequestedQuantityISOUnit: 'PCE' // Replace with actual field name
        });
      });
      const salesorderPayload = JSON.stringify(salesorder);
      const encodedPayload = btoa(salesorderPayload); // Base64 encode

      const payload = {
        encode: encodedPayload // Wrap encoded payload in an object
      };


      $.ajax({
        type: "POST",
        contentType: "application/json",

        url: url + "PostSalesOrderData",
        data: JSON.stringify(payload), // Send as JSON string
        success: function (response) {
          console.log("Success:", response);
          that._busyDialog2.close();
          localModel.setProperty("/generatedID", response.value.d.SalesOrder);
          const materialsObj = {};
          CustWiseCart.forEach(item => {
            materialsObj[item.material] = item.RequestedQuantityI;
          });

          const PayloadwhatsMessge = {
            SoldToParty: custID,
            SalesOrder: response.value.d.SalesOrder,
            materials: JSON.stringify(materialsObj) // Convert object to a string
          };
          localModel.setProperty("/PayloadwhatsMessge", PayloadwhatsMessge);
          that.updateCartDta();

          that._onObjectMatched();
          localModel.setProperty("/SimulateResponseItem", "");
          localModel.setProperty("/CustWiseCart", "");
          localModel.setProperty("/SimulateResponseOrder", "");
          localModel.setProperty("/simualtebutton", false);
          localModel.setProperty("/salesorderID", response);
          localModel.refresh();
          MessageBox.success("Sales Order has been created with Sales Order ID as " + response.value.d.SalesOrder);

         
          that.Whatsapp();
        },
      });



    },
