      // Retrieve summary data (SimulateResponseOrder array)
      var aSummary = oModel.getProperty("/SimulateResponseItem");
      var aSummaryOrder = oModel.getProperty("/SimulateResponseOrder");
      var custdata = oModel.getProperty("/getCustomerBasicDetail");

      // Initialize an array for the table body
      var aSummaryTableBody = [];

      // Add header row with bold text and brown color
      aSummaryTableBody.push([
        { text: 'Item ID', bold: true, color: 'brown' },
        { text: 'Item', bold: true, color: 'brown' },
        { text: 'Cost Amount', bold: true, color: 'brown' },
        { text: 'Net Amount', bold: true, color: 'brown' },
        { text: 'Tax Amount', bold: true, color: 'brown' }
      ]);

      // Loop through each item in SimulateResponseItem to populate the table
      aSummary.forEach(function (oItem) {
        aSummaryTableBody.push([
          oItem.Material || 'N/A',
          oItem.SalesOrderItemText || 'N/A',
          oItem.CostAmount || '0.00',
          oItem.NetAmount || '0.00',
          oItem.TaxAmount || '0.00'
        ]);
      });

      // Retrieve the total net amount directly from aSummaryOrder
      var totalNetAmount = aSummaryOrder || '0.00';

      // Add total row with the total net amount
      aSummaryTableBody.push([
        { text: 'Total', bold: true, color: 'brown' },
        '', // Empty cell for Item
        '', // Empty cell for Cost Amount
        { text: totalNetAmount, bold: true, color: 'brown' }, // Total Net Amount
        '' // Empty cell for Tax Amount
      ]);

      // var a = ""
