    initializeBusyDialog: function () {
      if (!this._busyDialog) {
        this._busyDialog = new sap.m.BusyDialog({
          text: "Thank you for your patience. We are Loading your invoice...",
          title: "Please Wait"
        });
      }
    }
    ,
    OnPressDownloadInvoice: function (oEvent) {
      const that = this;

      // Initialize and show the Busy Dialog

      const localModel = this.getView().getModel("localModel");
      const url = this.getOwnerComponent().getModel().getServiceUrl();
      var SalesOrder1 = oEvent.getSource().getBindingContext('localModel').getObject().SalesOrder;
      let payloadInvoice = { "SalesOrder": SalesOrder1 }
      $.ajax({
        type: "POST",
        contentType: "application/json",
        url: url + 'getBillingDocument',
        data: JSON.stringify(payloadInvoice),
        success: function (response) {
          console.log("Success:", response);
          localModel.setProperty("/BillingDocNumber", response.value);
          that.getBase64pdfInvoice();
          localModel.refresh();

          // debugger;
        },
        error: function () { },
      });
    },
    getBase64pdfInvoice: function (oEvent) {
      const that = this;
      const localModel = this.getView().getModel("localModel");
      const url = this.getOwnerComponent().getModel().getServiceUrl();
      const BillingNumber = localModel.getProperty("/BillingDocNumber")
      if (BillingNumber !== undefined && BillingNumber !== null && BillingNumber !== '') {
        this.initializeBusyDialog();
        this._busyDialog.open();
        let payloadBillingdoc = { "BillingDocument": BillingNumber }
        $.ajax({
          type: "POST",
          contentType: "application/json",
          url: url + 'getInvoicePDF',
          data: JSON.stringify(payloadBillingdoc),
          success: function (response) {
            console.log("Success:", response);
            localModel.setProperty("/Base64Invoice", response.value);
            that.renderPDF(response.value);
            localModel.refresh();
            that._busyDialog.close();
            // debugger;
          },
          error: function () { },
        });
      } else {
        // that._busyDialog.close();
        MessageBox.warning("Invoice for this Sales Order has not been generated yet.");
      }
    },




    renderPDF: function (base64Data) {
      const that = this;
      const byteCharacters = atob(base64Data); // Decode Base64 string
      const byteNumbers = new Array(byteCharacters.length).fill(0).map((_, i) => byteCharacters.charCodeAt(i));
      const byteArray = new Uint8Array(byteNumbers);
      const blob = new Blob([byteArray], { type: 'application/pdf' });
      const blobUrl = URL.createObjectURL(blob);

      // // Option 1: Open in a new tab
      // const link = document.createElement('a');
      // link.href = blobUrl;
      // link.download = 'invoice.pdf'; // Set the file name
      // document.body.appendChild(link);
      // link.click();
      // document.body.removeChild(link);
      // if (window.saveAs) {
      //   saveAs(blob, 'invoice.pdf'); // FileSaver.js function to download the file
      // } else {
      //   // Fallback for environments where FileSaver.js is not available
      //   const link = document.createElement('a');
      //   link.href = blobUrl;
      //   link.download = 'invoice.pdf';
      //   document.body.appendChild(link);
      //   link.click();
      //   document.body.removeChild(link); // Clean up the link element
      // }
      // Using a Blob URL and setting the download attribute directly
      const link = document.createElement('a');
      link.href = blobUrl;
      link.download = 'invoice.pdf'; // Set the filename for the download

      // Add the link to the DOM
      document.body.appendChild(link);

      // Trigger the download action
      link.click();

      // Clean up by removing the link after triggering the download
      document.body.removeChild(link);

      // If necessary, revoke the Blob URL to release resources
      URL.revokeObjectURL(blobUrl);
      that._busyDialog.close();
      // that._onObjectMatched();
      // Option 2: Show in an iframe or embed in your application
      // const iframe = document.createElement('iframe');
      // iframe.src = blobUrl;
      // iframe.style.width = '100%';
      // iframe.style.height = '100%';
      // document.body.appendChild(iframe);
    },
